def removeStars_(self, s: str) -> str:
	ast_idx_dict:dict = {}
	len_s = len(s)
	for i in range(len_s):
		if s[i] == '*':
			ast_idx_dict[i] = True

	s_list = list(s)
	for i in sorted(ast_idx_dict.keys()):
		t = i - 1
		while True:
			if s_list[t] != '*':
				if s_list[t] == '-':
					t -= 1
				else:
					s_list[i] = '-'
					s_list[t] = '-'
					break
			else:
				t -= 1
	
	out_str:str = ''
	for s in s_list:
		if s != '-':
			out_str += s

	return out_str

def removeStars(self, s: str) -> str:
	res = []
	for c in s:
		if c == '*':
			if res:
				res.pop()
		else:
			res.append(c)
	return ''.join(res)

